let editingCarId = null;

function printfCars(dataCars){
    const container= document.getElementById('cars-container');
    container.innerHTML='';
    dataCars.forEach((Cars)=>{
        const cards= `

             <div class="card-car border border-5 col-3 m-3 pb-2">

                <div class="image-card-car height-200-px mx-2 mt-2 border border-3">
                    <img src="${Cars.url}" height="100%" width="100%" alt="Ferrari">
                </div>

                <div class="button-edit mt-3 d-flex justify-content-end">
                    <button class="btn btn-warning" onclick="editCardCar(${Cars.id})"><i class="fas fa-pencil-alt"></i></button>
                    <button class="btn btn-danger ms-1" onclick="deleteCardCar(${Cars.id})"><i class="fas fa-trash-alt"></i></button>
                </div>

                <div class="brad-card-car mt-3">
                    <h5>Marca:</h5>
                </div>
                <div id="brad-car-data">
                    ${Cars.marca}
                </div>

                <div class="model-card-car mt-3">
                    <h5>Modelo:</h5>
                </div>
                <div id="model-car-data">
                    ${Cars.modelo}
                </div>

                <div class="color-card-car mt-3">
                    <h5>Color:</h5>
                </div>
                <div id="color-car-data">
                    ${Cars.color}
                </div>

                <div class="year-card-car mt-3">
                    <h5>Año:</h5>
                </div>
                <div id="year-car-data">
                    ${Cars.año}
                </div>

                <div class="price-card-car mt-3">
                    <h5>Precio:</h5>
                </div>

                <div id="price-car-data">
                    ${Cars.precio}
                </div>
            </div>`;
        container.innerHTML += cards;
    })
}

function ShowAddNewCar(){
    document.getElementById('section-add-new-car').classList.remove('d-none');
}

function ocultShowAddNewCar(){
    document.getElementById('section-add-new-car').classList.add('d-none');
}

function ActionBtn() {
    if(editingCarId) {
        updateDataCar();
    } else {
        addNewDataCatalogue();
    }
}

function updateDataCar() {
    const inputBranCarValue= document.getElementById('bran-car').value;
    const inputModelCarValue= document.getElementById('model-car').value;
    const inputColorCarValue= document.getElementById('color-car').value;
    const inputYearCarValue= document.getElementById('color-car').value;
    const inputPriceCarValue= document.getElementById('price-car').value;
    const inputImageCarValue= document.getElementById('image-car').value;
    const car = inicialCatalogueCars.find((car) => car.id === editingCarId)
    car.marca = inputBranCarValue;
    car.modelo = inputModelCarValue;
    car.color = inputColorCarValue;
    car.año = inputYearCarValue;
    car.precio = inputPriceCarValue;
    car.url = inputImageCarValue;
    printfCars(inicialCatalogueCars);
    editingCarId = null;
}

function addNewDataCatalogue(){
    const inputBranCarValue= document.getElementById('bran-car').value;
    const inputModelCarValue= document.getElementById('model-car').value;
    const inputColorCarValue= document.getElementById('color-car').value;
    const inputYearCarValue= document.getElementById('year-car').value;
    const inputPriceCarValue= document.getElementById('price-car').value;
    const inputImageCarValue= document.getElementById('image-car').value;

    const dataNewCar={
        id: generateIdCardCar(),
        marca: inputBranCarValue,
        modelo: inputModelCarValue,
        color: inputColorCarValue,
        año: inputYearCarValue,
        precio: inputPriceCarValue,
        url: inputImageCarValue
    }
    inicialCatalogueCars.push(dataNewCar);
    printfCars(inicialCatalogueCars);
}

function generateIdCardCar(){
    let biggerId='0';
    inicialCatalogueCars.forEach((data)=>{
        if (data.id > biggerId){
            biggerId= data.id
        }
    })
    return biggerId + 1;
}

function deleteCardCar(id){
   const idDelete=inicialCatalogueCars.findIndex((data)=> data.id===id);
   inicialCatalogueCars.splice(idDelete,1);
   printfCars(inicialCatalogueCars);
}

function editCardCar(id){
    editingCarId = id;
    const idEditCar= inicialCatalogueCars.findIndex((data)=> data.id === id);
    const dataEditCar= inicialCatalogueCars[idEditCar];
     document.getElementById('bran-car').value=dataEditCar.marca;
     document.getElementById('model-car').value=dataEditCar.modelo;
     document.getElementById('color-car').value=dataEditCar.color;
     document.getElementById('year-car').value=dataEditCar.año;
     document.getElementById('price-car').value=dataEditCar.precio;
     document.getElementById('image-car').value=dataEditCar.url;

    ShowAddNewCar();
    changeButtonAtEdit();
}

function changeButtonAtEdit(){
   const btnEdit= document.getElementById('Edit-data-car-catalogue');
   const btnAddCatalogue= document.getElementById('send-new-car-catalogue');
   btnEdit.classList.remove('d-none');
   btnAddCatalogue.classList.add('d-none');
}

function changeButtonAtAddNewCar() {
    const btnAddNewCar= document.getElementById('send-new-car-catalogue');
    const btnEdit=document.getElementById('Edit-data-car-catalogue');
    btnAddNewCar.classList.remove('d-none');
    btnEdit.classList.add('d-none');
}

function resetDataForm(){
    document.getElementById('form-card-data').reset();
}

